function Headers() {
  // <div className="lg:flex md:block hidden lg:justify-start md:justify-end justify-center items-center lg:pl-[21rem] md:pl-6 pl-4 ">
  return (
    <div className="fixed shadow-md w-full flex h-16 justify-between px-4">
      <Link to={""}>
        <div className=" h-12 flex w-full self-center items-center">
          <img src={logo} className="h-10" />
        </div>
      </Link>
      <div className="flex items-center">
        <nav>
          <Link to={""}>Home</Link>
          <Link to={"menu"}>Menu</Link>
          <Link to={"about"}>About</Link>
          <Link to={"contact"}>Contact</Link>
        </nav>
        <div className="">
          <FaUserAlt />
        </div>
        <div className="">
          <FaShoppingCart />
        </div>
      </div>
    </div>
  );
}

export default Headers;
